ping_last_name',''),(98,2,'shipping_company',''),(99,2,'shipping_address_1',''),(81,2,'last_activity','2018-09-02 09:05:15'),(82,2,'_woocommerce_persistent_cart_1','a:1:{s:4:\"cart\";a:0:{}}'),(289,1,'dismissed_wootenberg_notice','1'),(84,2,'pv_shop_name','Sighthosting'),(85,2,'pv_shop_slug','sighthosting'),(86,2,'pv_shop_description','<div class=\"wpb_column vc_column_container vc_col-sm-12\">\r\n<div class=\"vc_column-inner \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_text_column wpb_content_element vc_custom_1507372613031\">\r\n<div class=\"wpb_wrapper\">\r\n<h2 class=\"line center\">We Are the Platform of Choice</h2>\r\n</div>\r\n</div>\r\n<div class=\"wpb_text_column wpb_content_element vc_custom_1507752058833\">\r\n<div class=\"wpb_wrapper\">\r\n\r\nINTERNET SOLUTIONS FOR WEB HOSTING AND SO MUCH MORE\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"wpb_column vc_column_container vc_col-sm-12 vc_col-md-4\">\r\n<div class=\"vc_column-inner \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"icon-box box1\">\r\n<h5>DOMAIN NAME REGISTRATION</h5>\r\n<div class=\"icon-img\"></div>\r\n<div class=\"icon-box-content\">Creating your own online identity has never been more affordable! Choose from any of our extensions and enjoy plenty of perks.</div>\r\n</div>\r\n<div class=\"vc_empty_space\"></div>\r\n<div class=\"icon-box box1\">\r\n<h5>ONECLICK INSTALLERS</h5>\r\n<div class=\"icon-img\"></div>\r\n<div class=\"icon-box-content\">Create a WordPress blog or your own Wiki! Our web hosting packages come with a huge selection of 1-Click Installs; forums, CMS, polls, music apps and more.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"wpb_column vc_column_container vc_col-sm-12 vc_col-md-4\">\r\n<div class=\"vc_column-inner \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"icon-box box1\">\r\n<h5>LITESPEED WEB SERVER</h5>\r\n<div class=\"icon-img\"></div>\r\n<div class=\"icon-box-content\">LiteSpeed Web Server. All the features you love from regular Apache-based hosting, but without all the drawbacks; supercharged and tightly integrated</div>\r\n</div>\r\n<div class=\"vc_empty_space\"></div>\r\n<div class=\"icon-box box1\">\r\n<h5>LOCATION HOSTING</h5>\r\n<div class=\"icon-img\"></div>\r\n<div class=\"icon-box-content\">Choose from over 7 different locations to host your website in Europe (Netherlands, Italy, Spain, Poland, Czech Republic, France and Ireland), contact support to change this for you.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"wpb_column vc_column_container vc_col-sm-12 vc_col-md-4\">\r\n<div class=\"vc_column-inner \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"icon-box box1\">\r\n<h5>FREE SSL CERTIFICATES</h5>\r\n<div class=\"icon-img\"></div>\r\n<div class=\"icon-box-content\">Comodo Free Certificate is a fully functional Digital Certificate, valid for 90 days and is as trusted as our paid SSL certificates, request this service at anytime.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),(70,2,'billing_first_name','Lance'),(71,2,'billing_last_name','Spurgeon'),(72,2,'billing_company','sighthosting'),(73,2,'billing_address_1','3 Westminster Road'),(74,2,'billing_city','Crawley'),(75,2,'billing_postcode','RH10 7WZ'),(76,2,'billing_country','GB'),(77,2,'billing_email','orders@sighthosting.com'),(78,2,'billing_phone','07938119817'),(79,2,'shipping_method',''),(80,2,'wc_last_active','1535846400'),(87,2,'pv_seller_info','<div class=\"wpb_column vc_column_container vc_col-sm-12 vc_col-md-4\">\r\n<div class=\"vc_column-inner \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"feature-box icon2\">\r\n<div class=\"fea-top\">\r\n<h4>Affordable Prices</h4>\r\n</div>\r\n<div class=\"fea-content\">\r\n\r\nLooking for the best cheap web hosting package from a reliable provider? Sighthosting offers you inexpensive business packages for small and big businesses.\r\n\r\n<a class=\"morelink\" href=\"http://www.sighthosting.com/hosting/\" target=\"_self\">READ MORE</a>\r\n